import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>DT-Sec Programmieraufgabe</h1>
      </header>
      <div class="App-form-container">
        {/* Form für die Datei Eingabe */}
        <form>
          <label>Wähle ein CSR aus:</label>
          <input type="file" />
          <hr />
          <label>oder kopiere den Inhalt in folgende Box:</label>
          <input type="text" name="name" class="textfield" line="8" />
          <input type="submit" value="Submit" />
        </form>
      </div>
    </div>
  );
}

export default App;
